import React from 'react'


type Props = Readonly<{
    id: Number,
    label: String,
    onChange: () => null,
    value: String,
    name: String
}>

const TextInput = ({ id, label, onChange, value, name }: Props) => {
    return (
        <>
            <label htmlFor={id}>{label}</label>
            <input id={id} type="text" name="name" onChange={onChange} value={value}></input >
        </>
    )
}

export default TextInput
